import React from 'react'
import { btnBackgroundColor } from '../../uiConfig'

export default function Viewer(props) {
  return (
    <div style={{width: '90%', display: 'inline-block'}} align="left">
            <span style={{borderBottom: `2px solid ${btnBackgroundColor}`, fontSize: '17px'}}>{props.title}</span>
             <br/>
             <br/>
             <div style={{height: '60%', overFlowY: 'scroll', paddingLeft: '20px'}}  dangerouslySetInnerHTML={{__html: props.rawHtmlBody}}></div>
    </div>
  )
}
